import React, { Component } from "react";
import { authContext } from "../adal/config";
import { Nav, NabItem } from "react-bootstrap";

class NavBar extends Component {
  handleLogout = () => {
    authContext.logOut();
  };

  render() {
    return (
      <Nav>
        <NavItem />
      </Nav>
    );
  }
}
export default NavBar;
